import React from 'react';
import {Navlink} from 'react-router-dom';

const NavBar = () => (
  <nav className="flex justify-between bb b--white-10">
    <a className="link blue hover-white no-underline flex items-center pa3" href="">
      Welcome to the Blogger
    </a>
    <div className="flex-grow pa3 flex items-center">
      <a className="f6 link dib blue dim mr3 mr4-ns" href="#0">About</a>
      <a className="f6 link dib blue dim mr3 mr4-ns" href="#0">Sign In</a>
      <a className="f6 dib blue bg-animate hover-bg-white hover-black no-underline pv2 ph4 br-pill ba b--white-20" href="#0">Sign Up</a>
    </div>
  </nav>
);

export default NavBar;
